import React, { Component } from "react";

class Register extends Component {
  render() {
    return (
      <div class="register">
        <h1>Register </h1>
        <div class="field">
          <label> Email </label>
          <input type="text" />
        </div>

        <select class="option">
          <label> Region </label>
          <option> Region </option>
        </select>
      </div>
    );
  }
}

Register.propTypes = {};

export default Register;
